For @tmagazine's final issue of the year, we dropped in on twelve creative people's dinner parties around the world, from Tokyo to Lagos. A good dinner party is a piece of theater in itself: Take a bunch of people (all in various moods and mind frames), place them in a context governed not by law but by social expectations, add in a few bottles of alcohol and you have a potential tinderbox. It’s why we look forward to dinner parties, and why we dread them, too (and why they’ve always been such rich fodder for satirists). A host’s nightmare — a misbehaving guest; a disagreement that accelerates into a full-blown fight — can make for delicious art. Yet at its best, a dinner party is an act of communion. It’s defined by generosity: Someone is feeding you; someone is inviting you to sit down with them. It’s a gesture of peacemaking, of intimacy, of trust. We wanted to know how people were gathering these days: What were they talking about (and not talking about)? What were they eating? What were they listening to? Find out for yourself at tmagazine.com. Our covers are: the cast and creators of the film “Women Talking” in New York, photographed by @jasonschmidtstudio  
  
